import { Fragment, useState } from 'react';
import React from 'react';
import './Header_phone.css';
import Navigation from '../Navigation/navigation';
import Logo from '../logo/logo';
import BtClicked from '../../Context/Button-clicked';

const Header_phone=(props)=>{
    const [clicked,Setclick]=useState(true);

    return(
            <BtClicked.Provider value={{
                isClicked:clicked
            }}>
                <header className={`Header ${props.scrollDet>99?"heightDec":""}`}>    
                <Logo click={clicked}></Logo>
                <Navigation clickHandle={ClickHandler}></Navigation>
                </header>
                </BtClicked.Provider>
    );
};

export default Header_phone;
